export const ListAttributes = {
  pageSize: 20,
  subListIndent: 30,
  rowSelectionType: "checkbox",
  paginationPosition: ["bottomCenter"],
  statusColors: {
    DEFAULT: "#000000",
    IN_PROGRESS: "FF0000",
    DONE: "#FFA500",
    COMPLETE: "#00FF00",
  },
};
